import React, { Component } from 'react';
import './style.css';



class Packages extends Component {

constructor(props) {
    super(props);
    this.state = {
        name: [],
        isLoaded: false,
    }
}

componentDidMount() {
    fetch('http://localhost:3000/packages')
        .then(res => res.json())
        .then(json => {
            this.setState({
                isLoaded:true,
                name: json,
            })
        });
}

render() {
    var { isLoaded, name } = this.state;

    if (!isLoaded) {
        return <div>Loading...</div>;
